import React from 'react';
import {StyleSheet, Text, View} from "react-native";

export const RegSuccess = () => {
    return (
        <View>
            <Text style={styles.header}>REGISZTRÁCIÓ, FELIRATKOZÁS</Text>
            <Text style={styles.success}>Sikeres regisztráció :)</Text>
            <Text style={styles.text}>Másodperceken belül használhatod... :)</Text>
        </View>
    )
};

const styles = StyleSheet.create({
    header: {
        alignSelf: 'center',
        fontSize: 20,
        padding: 10,
        marginBottom: 40,
    },
    text: {
        color: '#63E300',
        alignSelf: 'center',
        fontSize: 14,
        padding: 10,
    },
    success: {
        color: '#D50000',
        alignSelf: 'center',
        fontSize: 14,
        padding: 10,
        marginBottom: 100,
    }
});
